import logo from './logo.svg';
import './App.css';
import Layout from './Layout/Layout';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

function App() {
  return (

   <Router>
   <Routes>
     <Route path="/" element={ <Layout/>} />
   </Routes>
 </Router>
  );
}

export default App;
